write a Python program to print out the first 100 prime numbers
Here's an example of how you can generate and print the first 100 prime numbers using Python:
```python
for i in range(2, 101):
    is_prime = True
    for j in range(2, int(i ** 0.5) + 1):
        if i % j == 0:
            is_prime = False
            break
    if is_prime:
        print(i)
```This program uses a loop to iterate through the numbers from 2 to 100 (inclusive). For each number, it checks whether or not it's prime by using another loop that goes up to the square root of the current number. If any multiple of this smaller number is found, then the current number cannot be a prime and we move on to the next one. Otherwise, if no such multiple was found, we print out the current number as being prime.
Note that this program assumes that you're using Python 3 (which has support for integer division), so it may not work in earlier versions of the language. Also, keep in mind that there are more efficient ways to generate and test primes than what's shown here!
